import React from 'react';

const SuperLinesSelector = React.memo(function ({lines, setLines}) {

    let onSelectorChange = () => {
        console.log(document.getElementsByClassName('lines_selector')[0].value);
    }
    onSelectorChange = onSelectorChange.bind(document.getElementsByClassName('lines_selector')[0]);

    return <input type="range"
                  min="1"
                  max="50"
                  step="1"
                  value={lines}
                  className='lines_selector'
                  onChange={onSelectorChange}/>
});

export default SuperLinesSelector;
